import { TextField } from '@mui/material'
import React from 'react'

const Login = () => {
  return (
    <div>
        <br/>
        <TextField variant='outlined' label='outlined'>USERNAME</TextField>
        <TextField variant='outlined' label='outlined'>PASSWORD</TextField>
    </div>
  )
}

export default Login
